INSERT INTO `component_lowcode_segment_template` (`id`, `code`, `name`, `compute_template`, `name_template`, `name_output_variable`, `content_template`, `reference_segment_template_id`, `output_type_dict_id`, `output_variable`, `share_variables`, `remark`, `level`, `parent_id`, `parent_id1`, `parent_id2`, `parent_id3`, `parent_id4`, `parent_id5`, `parent_id6`, `parent_id7`, `parent_id8`, `parent_id9`, `parent_id10`, `version`, `tenant_id`, `create_at`, `create_by`, `update_at`, `update_by`) VALUES (1626597948923662337, NULL, 'application.yml', NULL, '#(parent.nameVar + sys.fileSeparator)application.yml', NULL, 'spring:\n  application:\n    # 应用名称\n    name: #(global.moduleName)-start\n  profiles:\n    include:\n      - knife4j\n      - swagger\n      - log4j2\n      - sleuth\n      - datasource\n      - mybatis-plus\n  datasource:\n    dynamic:\n      primary: master #设置默认的数据源或者数据源组,默认值即为 master\n      strict: false #严格匹配数据源,默认false. true未匹配到指定数据源时抛异常,false使用默认数据源\n      datasource:\n        master:\n          url: jdbc:mysql://localhost/particle_test?${particle.datasource.mysql.url-query}\n          username: root\n          password: rootroot\n          driver-class-name: ${particle.datasource.mysql.driver} # 3.2.0开始支持SPI可省略此配置\n  # 注意，这里的配置是spring的但实现已经自定义，参考 global-datasource-boot-starter 组件 sqlinit 包实现\n  sql:\n    init:\n      schema-locations:\n        - classpath:db/schema.#(global.moduleName).sql\n      data-locations:\n        - classpath:db/data.#(global.moduleName).sql\n      mode: ALWAYS # ALWAYS NEVER\nserver:\n  servlet:\n    encoding:\n      # 在接收请求和返回数据，强制 utf-8 编码\n      # encoding 配置默认为 utf-8 编码 参见：org.springframework.boot.web.servlet.server.Encoding.DEFAULT_CHARSET\n      force: true\n', NULL, 1625787619817914370, NULL, NULL, NULL, 5, 1626597948525203457, 1625809840082800641, 1626039878971580418, 1626597947753451521, 1626597948525203457, 1626597948718141441, NULL, NULL, NULL, NULL, NULL, 1, 1, '2023-02-17 23:02:26', NULL, NULL, NULL);
