\n     * @param #(item.propertyName)s\n     * @return\n     */\n    default List<#(ext.model.nameEnEntity)DO> getBy#(item.propertyName.upperFirst())s(List<#(item.propertyType)> #(item.propertyName)s) {\n        Assert.notEmpty(#(item.propertyName)s,\"#(item.propertyName)s 不能为空\");\n        return list(Wrappers.<#(ext.model.nameEnEntity)DO>lambdaQuery().in(#(ext.model.nameEnEntity)DO::#(getProperty), #(item.propertyName)s));\n    }\n    #if( !isObjNull(item.propertyFullType))\n    #if(parents.share.import.add(\'import \' + item.propertyFullType + \';\'))#end\n    #end\n    #if(parents.share.import.add(\'import com.baomidou.mybatisplus.core.toolkit.Wrappers;\'))#end\n    #if(parents.share.import.add(\'import com.particle.global.exception.Assert;\'))#end\n    #if(parents.share.import.add(\'import java.util.List;\'))#end\n\n\n    #end\n    #end\n', NULL, 1625787765335097345, 'serviceForeignKeyMethod', NULL, NULL, 8, 1627902248853516289, 1627576731172417538, 1627576748029325314, 1627576748591362050, 1627576748926906370, 1627576749212119042, 1627899834297561090, 1627902248853516289, NULL, NULL, NULL, 1, 1, '2023-02-26 10:38:18', NULL, NULL, NULL);
