INSERT INTO `component_lowcode_segment_template` (`id`, `code`, `name`, `compute_template`, `name_template`, `name_output_variable`, `content_template`, `reference_segment_template_id`, `output_type_dict_id`, `output_variable`, `share_variables`, `remark`, `level`, `parent_id`, `parent_id1`, `parent_id2`, `parent_id3`, `parent_id4`, `parent_id5`, `parent_id6`, `parent_id7`, `parent_id8`, `parent_id9`, `parent_id10`, `version`, `tenant_id`, `create_at`, `create_by`, `update_at`, `update_by`) VALUES (1630043241455366145, NULL, 'adminApi.ts', NULL, '#(parent.nameVar + sys.fileSeparator + ext.model.nameEnEntityVar + \'AdminApi.ts\')', NULL, 'import axios, { AxiosPromise} from \'axios\'\nimport {anyObj} from \"../../../../../../global/common/tools/ObjectTools\";\nimport {IdParam, updateParam} from \"../../../../../../common/api/api\";\n\nlet #(ext.model.nameEnEntityVar)Prefix = \'/admin/web/#(ext.model.requestPath)\'\n/**\n * 添加#(ext.model.name)\n * @param data\n */\nexport const create = (data: anyObj): AxiosPromise => {\n    return axios.post(#(ext.model.nameEnEntityVar)Prefix + \'/create\',data)\n}\n/**\n * 删除#(ext.model.name)\n * @param data\n */\nexport const remove = (data: IdParam): AxiosPromise => {\n    return axios.delete(#(ext.model.nameEnEntityVar)Prefix + \'/delete\',{data: data})\n}\n/**\n * 更新#(ext.model.name)\n * @param data\n */\nexport const update = (data: updateParam): AxiosPromise => {\n    return axios.put(#(ext.model.nameEnEntityVar)Prefix + \'/update\',data)\n}\n/**\n * 更新时使用，加载要更新的数据\n * @param data\n */\nexport const detailForUpdate = (data: IdParam): AxiosPromise => {\n    return axios.get(#(ext.model.nameEnEntityVar)Prefix + \'/detail-for-update\',{params: data})\n}\n/**\n * 列表，没有分页，查询全部数据\n * @param data\n */\nexport const list = (data: anyObj): AxiosPromise => {\n    return axios.get(#(ext.model.nameEnEntityVar)Prefix + \'/list\',{params: data})\n}\n/**\n * 列表，分页\n * @param data\n */\nexport const page = (data: anyObj): AxiosPromise => {\n    return axios.get(#(ext.model.nameEnEntityVar)Prefix + \'/page\',{params: data})\n}\n\n', NULL, 1625787619817914370, NULL, NULL, NULL, 4, 1630036514559279106, 1630035622632144898, 1630035622862831617, 1630036514559279106, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2023-02-27 11:12:48', NULL, NULL, NULL);
INSERT INTO `component_lowcode_segment_template` (`id`, `code`, `name`, `compute_template`, `name_template`, `name_output_variable`, `content_template`, `reference_segment_template_id`, `output_type_dict_id`, `output_variable`, `share_variables`, `remark`, `level`, `parent_id`, `parent_id1`, `parent_id2`, `parent_id3`, `parent_id4`, `parent_id5`, `parent_id6`, `parent_id7`, `parent_id8`, `parent_id9`, `parent_id10`, `version`, `tenant_id`, `create_at`, `create_by`, `update_at`, `update_by`) VALUES (1630044570110210050, NULL, 'ManagePage.vue', NULL, '#(parent.nameVar + sys.fileSeparator + (ext.model.nameEnEntity) +  \'ManagePage.vue\')', NULL, '<script setup name=\"#(ext.model.nameEnEntity)ManagePage\" lang=\"ts\">\n/**\n * #(ext.model.name)管理页面\n */\nimport {reactive, ref} from \'vue\'\nimport { page as #(ext.model.nameEnEntity)PageApi, remove as #(ext.model.nameEnEntity)RemoveApi} from \"../../#(global.packageModule==null || global.packageModule==\'\' ? \'api\' : \'../api/\' +  global.packageModule)/admin/#(ext.model.nameEnEntity)AdminApi\"\nimport {pageFormItems} from \"../../#(global.packageModule==null || global.packageModule==\'\' ? \'compnents\' : \'../compnents/\' +  global.packageModule)/admin/#(ext.model.nameEnEntityVar)Manage\";\n\n\nconst tableRef = ref(null)\n\n// 属性\nconst reactiveData = reactive({\n  // 表单初始查询第一页\n  form: {\n  },\n  formComps: pageFormItems,\n  tableColumns: [\n    #for(item : ext.modelItems)\n    #set(jsonItemMap = item.designJsonMap.jsonItemMap)\n    #set(VO = jsonItemMap.VO)\n    #if(VO.isUse)\n    #if(VO.isTransDictId)\n    {\n      prop: \'#(item.propertyName.replace(\'Id\',\'\') + \'Name\')\',\n      label: \'#(item.commentSimple)\',\n    },\n    #else\n    {\n      prop: \'#(item.propertyName)\',\n      label: \'#(item.commentSimple)\',\n    },\n    #end\n    #end\n    #end\n  ],\n\n})\n\n// 提交按钮属性\nconst submitAttrs = ref({\n  buttonText: \'查询\',\n  loading: false,\n  permission: \'admin:web:#(ext.model.nameEnEntity):pageQuery\'\n})\n// 查询按钮\nconst submitMethod = ():void => {\n  tableRef.value.refreshData()\n}\n// 分页数据查询\nconst do#(ext.model.nameEnEntity)PageApi = ({pageQuery}: {param: object,pageQuery: {pageNo: number,pageSize: number}}) => {\n  return #(ext.model.nameEnEntity)PageApi({...reactiveData.form,...pageQuery})\n}\nconst tablePaginationProps = {\n  permission: submitAttrs.value.permission\n}\n// 表格操作按钮\nconst getTableRowButtons = ({row, column, $index}) => {\n  if($index < 0){\n    return []\n  }\n  let idData = {id: row.id}\n  let tableRowButtons = [\n    {\n      txt: \'编辑\',\n      text: true,\n      permission: \'admin:web:#(ext.model.nameEnEntity):update\',\n      // 跳转到编辑\n      route: {path: \'/admin/#(ext.model.nameEnEntity)ManageUpdate\',query: idData}\n    },\n    {\n      txt: \'删除\',\n      text: true,\n      permission: \'admin:web:#(ext.model.nameEnEntity):delete\',\n      methodConfirmText: `确定要删除 ${row.name} 吗？`,\n      // 删除操作\n      method(){\n        return #(ext.model.nameEnEntity)RemoveApi({id: row.id}).then(res => {\n          // 删除成功后刷新一下表格\n          submitMethod()\n          return Promise.resolve(res)\n        })\n      }\n    }\n  ]\n  return tableRowButtons\n}\n</script>\n<template>\n  <!-- 查询表单 -->\n  <PtForm :form=\"reactiveData.form\"\n          :method=\"submitMethod\"\n          defaultButtonsShow=\"submit,reset\"\n          :submitAttrs=\"submitAttrs\"\n          inline\n          :comps=\"reactiveData.formComps\">\n    #[[<template #buttons>]]#\n      <PtButton permission=\"admin:web:#(ext.model.nameEnEntity):create\" route=\"/admin/#(ext.model.nameEnEntity)ManageAdd\">添加</PtButton>\n    </template>\n  </PtForm>\n<!-- 指定 dataMethod，默认加载数据 -->\n  <PtTable ref=\"tableRef\"\n           default-expand-all\n           :dataMethod=\"do#(ext.model.nameEnEntity)PageApi\"\n           @dataMethodDataLoading=\"(loading) => submitAttrs.loading=loading\"\n           :dataMethodResultHandleConvertToTree=\"true\"\n           :paginationProps=\"tablePaginationProps\"\n           :columns=\"reactiveData.tableColumns\">\n\n    <!--  操作按钮  -->\n    #[[<template #defaultAppend>]]#\n      <el-table-column label=\"操作\" width=\"180\">\n        #[[<template #default=\"{row, column, $index}\">]]#\n          <PtButtonGroup :options=\"getTableRowButtons({row, column, $index})\">\n          </PtButtonGroup>\n        </template>\n      </el-table-column>\n    </template>\n  </PtTable>\n<!-- 子级路由 -->\n  <PtRouteViewPopover :level=\"3\"></PtRouteViewPopover>\n</template>\n\n\n<style scoped>\n\n</style>', NULL, 1625787619817914370, NULL, NULL, NULL, 4, 1630084303444062210, 1630035622632144898, 1630035623622000642, 1630084303444062210, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 1, '2023-02-27 11:18:05', NULL, '2023-03-08 15:08:45', 1);
INSERT INTO `component_lowcode_segment_template` (`id`, `code`, `name`, `compute_template`, `name_template`, `name_output_variable`, `content_template`, `reference_segment_template_id`, `output_type_dict_id`, `output_variable`, `share_variables`, `remark`, `level`, `parent_id`, `parent_id1`, `parent_id2`, `parent_id3`, `parent_id4`, `parent_id5`, `parent_id6`, `parent_id7`, `parent_id8`, `parent_id9`, `parent_id10`, `version`, `tenant_id`, `create_at`, `create_by`, `update_at`, `update_by`) VALUES (1630044674846175233, NULL, 'ManageAddPage.vue', NULL, '#(parent.nameVar + sys.fileSeparator + (ext.model.nameEnEntity) +  \'ManageAddPage.vue\')', NULL, '<script setup name=\"#(ext.model.nameEnEntity)ManageAddPage\" lang=\"ts\">\n/**\n * #(ext.model.name)管理添加页面\n */\nimport {reactive ,ref} from \'vue\'\nimport {create as #(ext.model.nameEnEntity)CreateApi,list as #(ext.model.nameEnEntity)ListApi} from \"../../#(global.packageModule==null || global.packageModule==\'\' ? \'api\' : \'../api/\' +  global.packageModule)/admin/#(ext.model.nameEnEntity)AdminApi\"\nimport {addPageFormItems} from \"../../#(global.packageModule==null || global.packageModule==\'\' ? \'compnents\' : \'../compnents/\' +  global.packageModule)/admin/#(ext.model.nameEnEntityVar)Manage\";\n\n\n// 属性\nconst reactiveData = reactive({\n  // 表单初始查询第一页\n  form: {},\n  // 表单数据对象\n  formData: {},\n})\n// 表单项\nconst formComps = ref(\n    addPageFormItems\n)\n\n// 提交按钮属性\nconst submitAttrs = ref({\n  buttonText: \'确认添加\',\n  permission: \'admin:web:#(ext.model.nameEnEntity):create\',\n})\n// 提交按钮\nconst submitMethod = () => {\n  return #(ext.model.nameEnEntity)CreateApi\n}\n// 成功提示语\nconst submitMethodSuccess = () => {\n  return \'添加成功，请刷新数据查看\'\n}\n\n</script>\n<template>\n  <!-- 添加表单 -->\n  <PtForm :form=\"reactiveData.form\"\n          :formData=\"reactiveData.formData\"\n          labelWidth=\"80\"\n          :method=\"submitMethod()\"\n          :methodSuccess=\"submitMethodSuccess\"\n          defaultButtonsShow=\"submit,reset\"\n          :submitAttrs=\"submitAttrs\"\n          :buttonsTeleportProps=\"$route.meta.formButtonsTeleportProps\"\n          inline\n          :comps=\"formComps\">\n  </PtForm>\n</template>\n\n\n<style scoped>\n\n</style>', NULL, 1625787619817914370, NULL, NULL, NULL, 4, 1630084303444062210, 1630035622632144898, 1630035623622000642, 1630084303444062210, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 1, '2023-02-27 11:18:30', NULL, '2023-03-08 15:09:33', 1);
INSERT INTO `component_lowcode_segment_template` (`id`, `code`, `name`, `compute_template`, `name_template`, `name_output_variable`, `content_template`, `reference_segment_template_id`, `output_type_dict_id`, `output_variable`, `share_variables`, `remark`, `level`, `parent_id`, `parent_id1`, `parent_id2`, `parent_id3`, `parent_id4`, `parent_id5`, `parent_id6`, `parent_id7`, `parent_id8`, `parent_id9`, `parent_id10`, `version`, `tenant_id`, `create_at`, `create_by`, `update_at`, `update_by`) VALUES (1630044692088958978, NULL, 'ManageUpdatePage.vue', NULL, '#(parent.nameVar + sys.fileSeparator + (ext.model.nameEnEntity) +  \'ManageUpdatePage.vue\')', NULL, '<script setup name=\"AreaManageUpdatePage\" lang=\"ts\">\n/**\n * #(ext.model.name)管理更新页面\n */\nimport {reactive, ref} from \'vue\'\nimport {\n  update as #(ext.model.nameEnEntity)UpdateApi,\n  detailForUpdate as detailForUpdateApi,\n  list as #(ext.model.nameEnEntity)ListApi\n} from \"../../#(global.packageModule==null || global.packageModule==\'\' ? \'api\' : \'../api/\' +  global.packageModule)/admin/#(ext.model.nameEnEntity)AdminApi\"\n\nimport {updatePageFormItems} from \"../../#(global.packageModule==null || global.packageModule==\'\' ? \'compnents\' : \'../compnents/\' +  global.packageModule)/admin/#(ext.model.nameEnEntityVar)Manage\";\n\n\n// 声明属性\n// 只要声名了属性 attrs 中就不会有该属性了\nconst props = defineProps({\n  // 加载数据初始化参数,路由传参\n  #(ext.model.nameEnEntityVar)Id: {\n    type: String\n  }\n})\n// 属性\nconst reactiveData = reactive({\n  // 表单\n  form: {\n    id: props.#(ext.model.nameEnEntityVar)Id,\n    version: 1\n  },\n  // 表单数据对象\n  formData: {},\n})\n// 表单项\nconst formComps = ref(\n    updatePageFormItems\n)\n\n// 提交按钮属性\nconst submitAttrs = ref({\n  buttonText: \'确认修改\',\n  permission: \'admin:web:#(ext.model.nameEnEntity):update\',\n})\n// 提交按钮\nconst submitMethod = () => {\n  return #(ext.model.nameEnEntity)UpdateApi\n}\n// 初始化加载更新的数据\nconst dataMethod = () => {\n  return detailForUpdateApi({id: props.#(ext.model.nameEnEntityVar)Id})\n}\n// 成功提示语\nconst submitMethodSuccess = () => {\n  return \'修改成功，请刷新数据查看\'\n}\n\n</script>\n<template>\n  <!-- 添加表单 -->\n  <PtForm :form=\"reactiveData.form\"\n          :formData=\"reactiveData.formData\"\n          labelWidth=\"80\"\n          :dataMethod=\"dataMethod\"\n          :method=\"submitMethod()\"\n          :methodSuccess=\"submitMethodSuccess\"\n          defaultButtonsShow=\"submit,reset\"\n          :submitAttrs=\"submitAttrs\"\n          :buttonsTeleportProps=\"$route.meta.formButtonsTeleportProps\"\n          inline\n          :comps=\"formComps\">\n  </PtForm>\n\n</template>\n\n\n<style scoped>\n\n</style>', NULL, 1625787619817914370, NULL, NULL, NULL, 4, 1630084303444062210, 1630035622632144898, 1630035623622000642, 1630084303444062210, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, 1, '2023-02-27 11:18:34', NULL, '2023-03-08 15:10:03', 1);
