 {\n          name: \'#(item.propertyName)\',\n        },\n        element: {\n        #if(item.propertyType == \'String\')\n          comp: \'el-input\',\n        #else if(item.propertyType == \'Boolean\')\n          comp: \'el-switch\',\n        #else if(UPDATE.isDict || UPDATE.isTransDictId)\n          comp: \'PtDictFrontSelect\',\n        #else if(propertyType == \'LocalDateTime\' || propertyType == \'LocalDate\')\n          comp: \'PtDatePicker\',\n        #else\n          comp: \'el-input\',\n        #end\n          formItemProps: {\n            label: \'#(item.commentSimple)\',\n            #if(UPDATE.isRequired)required: true,#end\n          },\n          compProps: {\n          #if(item.propertyType == \'String\')\n            clearable: true,\n          #end\n          #if(UPDATE.isDict || UPDATE.isTransDictId)\n            // 字典查询\n            dictParam: {groupCode: \'这里填写字典组编码\'}\n          #end\n          #if(propertyType == \'LocalDateTime\')\n            type: \"datetime\"\n          #end\n          #if(propertyType == \'LocalDate\')\n            type: \"date\"\n          #end\n          }\n        }\n      },\n    #end\n    #end\n]\n#end\n\n', NULL, 1625787619817914370, NULL, NULL, NULL, 4, 1630084564933750785, 1630035622632144898, 1630035623261290498, 1630084564933750785, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2023-03-01 13:46:52', NULL, NULL, NULL);
